import React from 'react';

/**
 * Renders/Displays website elements.
 */
const HeaderBar = function (props) {
    return (
        <div className="header-titles">
            <h1>Travel Nerd</h1>
            <p>Using create-react-app</p>
        </div>
    );
}

export default HeaderBar;
